style.css:
@-moz-document url("https://neal.fun/infinite-craft/") {
html {
        filter: invert(100%);
    }
    
    .item {
        filter: hue-rotate(190deg);
        border-width: 2px !important;
    }
    
    .item > span {
        filter: invert(100%) hue-rotate(-190deg);
    }
}
